import Modal from "react-modal";
import React, { useState, useRef } from "react";
import filter from "../img/filter.png";
import cancel from "../img/cancel.png";
import styles from "./ModalContent.module.css";

const ModalContent = () => {
  const ageInput = useRef();

  const [modalIsOpen, setModalIsOpen] = useState(false);

  const [state, setState] = useState({
    area: "",
    grade: "",
    status: "",
    age: "",
  });

  const handleChangeState = (e) => {
    setState({
      ...state,
      [e.target.name]: e.target.value,
    });
  };

  const [isSelectionComplete, setIsSelectionComplete] = useState(false);

  const areAllFieldsSelected =
    state.area && state.grade && state.status && state.age;

  const handleModalOpen = () => {
    setIsSelectionComplete(false); // 모달 열 때 선택 완료 상태 초기화
    setModalIsOpen(true);
  };

  return (
    <div>
      <button className={styles.filterbutton} onClick={handleModalOpen}>
        <img src={filter} className={styles.filtericon} alt="filtericon"></img>
      </button>
      <Modal
        className={styles.modal}
        isOpen={modalIsOpen}
        onRequestClose={() => setModalIsOpen(false)}
      >
        <div className={styles.modalbody}>
          <div className={styles.header}>
            <div className={styles.headerleft}>
              <img src={filter} className={styles.headericon}></img>
              <span>필터</span>
            </div>
            <div className={styles.headerright}>
              <button
                className={styles.filterx}
                onClick={() => setModalIsOpen(false)}
              >
                <img src={cancel} alt="cancel"></img>
              </button>
            </div>
          </div>
          <div className={styles.content}>
            <ul>
              <li>
                <span className={styles.bold}>지역</span>
                <div className={styles.customSelect}>
                  <div
                    className={styles.selectedValue}
                    onClick={() => console.log("Selected 지역")}
                  >
                    {state.area || "지역을 선택해 주세요"}
                  </div>
                  <ul className={styles.optionsList}>
                    <li
                      className={styles.option}
                      onClick={() => handleChangeState("area", "서울")}
                    >
                      서울
                    </li>
                    <li
                      className={styles.option}
                      onClick={() => handleChangeState("area", "부산")}
                    >
                      부산
                    </li>
                    <li
                      className={styles.option}
                      onClick={() => handleChangeState("area", "광주")}
                    >
                      광주
                    </li>
                    <li
                      className={styles.option}
                      onClick={() => handleChangeState("area", "대구")}
                    >
                      대구
                    </li>
                  </ul>
                </div>
              </li>
              <li>
                <span className={styles.bold}>학력</span>
                <select
                  className={styles.filterselect}
                  name="grade"
                  value={state.grade}
                  onChange={handleChangeState}
                >
                  <option className={styles.options} value="" disabled>
                    학력을 선택해 주세요
                  </option>
                  <option className={styles.options} value={"대학교 재학"}>
                    대학교 재학
                  </option>
                  <option className={styles.options} value={"대학교 휴학"}>
                    대학교 휴학
                  </option>
                  <option className={styles.options} value={"대학교 졸업"}>
                    대학교 졸업
                  </option>
                  <option className={styles.options} value={"취업 준비"}>
                    취업 준비
                  </option>
                </select>
              </li>
              <li>
                <span className={styles.bold}>구직 상태</span>
                <select
                  className={styles.filterselect}
                  name="status"
                  value={state.status}
                  onChange={handleChangeState}
                >
                  <option className={styles.options} value="" disabled>
                    구직 상태를 선택해 주세요
                  </option>
                  <option className={styles.options} value={"프리랜서"}>
                    프리랜서
                  </option>
                  <option className={styles.options} value={"학생"}>
                    학생
                  </option>
                  <option className={styles.options} value={"회사원"}>
                    회사원
                  </option>
                </select>
              </li>
              <li>
                <span className={styles.bold}>연령</span>
                <div className={styles.agetext}>
                  <span>만</span>
                  <input
                    ref={ageInput}
                    name="age"
                    value={state.age}
                    onChange={handleChangeState}
                  />
                </div>
                <span className={styles.agefinish}>세</span>
              </li>
            </ul>
          </div>
          <button
            className={`${styles.filterfinish} ${
              areAllFieldsSelected ? "" : styles.disabled
            }`}
            onClick={() => setModalIsOpen(false)}
            disabled={!areAllFieldsSelected}
          >
            선택 완료
          </button>
        </div>
      </Modal>
    </div>
  );
};

export default ModalContent;
